import React, { useEffect } from 'react';

export default function Rating(props) {
  const { rating, numReviews } = props;
  let tempStar = [];
  const showRating = () => {
    let nStar = parseInt(rating);
    console.log(nStar);
    for (let i = 0; i < nStar; i++) {
      tempStar.push(1);
    }
  };
  useEffect(() => {
    showRating();
  }, []);
  return (
    <div>
      {tempStar.map((res) => {
        <div>{res}</div>;
      })}
    </div>
  );
}
